import React from 'react';
import { Link } from 'react-router-dom';

const Header = () => {
    return (
        <header className="bg-white shadow-md">
            <nav className="container mx-auto px-6 py-3">
                <div className="flex justify-between items-center">
                    <Link to="/" className="text-2xl font-bold text-gray-800">
                        TravelPlanner
                    </Link>
                    <div>
                        <Link to="/" className="text-gray-800 hover:text-blue-500 mx-2">
                            Home
                        </Link>
                        <Link to="/planner" className="text-gray-800 hover:text-blue-500 mx-2">
                            Planner
                        </Link>
                         <Link to="/login" className="bg-blue-500 hover:bg-blue-600 text-white font-bold py-2 px-4 rounded-full ml-4">
                            Login
                        </Link>
                    </div>
                </div>
            </nav>
        </header>
    );
};

export default Header;
